"125816":{"id":"125816","name":"As Flores Perdidas de Alice Hart","slug":"as-flores-perdidas-de-alice-hart","original_title":"The Lost Flowers of Alice Hart","overview":"Depois de perder os pais aos nove anos de idade em um incêndio misterioso, Alice Hart é criada pela avó June em uma fazenda de flores onde se depara com uma série de segredos. Anos mais tarde, a descoberta de uma traição obriga Alice a encarar seu passado.","first_air_date":"2023-08-03","episode_run_time":0,"vote_average":7.718,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Sarah Lambert"],"production_companies":["Made Up Stories","Fifth Season","Amazon Studios"],"genres":["Drama","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/koU92vPMZFoWn2SD1w0IoOzAxFm.jpg","poster_path":"https://image.tmdb.org/t/p/original/30Iwanr8AVcpyilSRdzUyKdi2mo.jpg","cast":["Sigourney Weaver","Alycia Debnam-Carey","Asher Keddie","Leah Purcell","Frankie Adams"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/30Iwanr8AVcpyilSRdzUyKdi2mo.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/30Iwanr8AVcpyilSRdzUyKdi2mo.jpg","air_date":"2023-08-03","episode_count":7,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Parte um: Orquídea Fogo Negro","overview":"Depois que Alice Hart, de 9 anos, sobrevive a um terrível incêndio em casa, ela é levada por sua avó, Junia, para o Campo de Espinhos, uma remota propriedade rural com vastos campos de flores e muitos segredos.","air_date":"2023-08-03","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/vECU1HVIPTlphiM48SaGkIhEpOY.jpg","vote_average":0},"2":{"name":"Parte dois: Acácia","overview":"Quando Alice é apresentada à vida no Campo de Espinhos, são sua tia Dulce Azul e as Flores - as mulheres para quem Campo de Espinhos é um refúgio - que fazem Alice se sentir bem-vinda. Embora Junia afirme que a mãe de Alice, Agnes, nunca tenha estado no Campo dos Espinhos, Alice sente sua presença em todos os cantos.","air_date":"2023-08-03","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/6kwpkZrRRhkQreELUEWwR5wZs6z.jpg","vote_average":0},"3":{"name":"Parte três: Arbusto-lanterna","overview":"Quando Alice finalmente solta a voz, ela exige respostas sobre sua família, mas Junia continua tecendo uma teia de mentiras para esconder um passado doloroso e cheio de vergonha.","air_date":"2023-08-03","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/oXbMNe4Rx27xlPcVvMrSI9eLGmF.jpg","vote_average":0},"4":{"name":"Parte quatro: Lírio-do-rio","overview":"Depois de descobrir evidências da extensão chocante das mentiras e manipulações de sua avó, Alice, agora com 24 anos, foge do Campo de Espinhos e começa a construir uma nova vida em uma cidade no deserto chamada Agnes Bluff.","air_date":"2023-08-10","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/v4wv3b33MX0gf8N1ejPngDf69CR.jpg","vote_average":0},"5":{"name":"Parte cinco: Carvalho-do-deserto","overview":"Enquanto Rama procura por Alice, Dulce confronta Junia sobre o passado. Em Agnes Bluff, Alice acredita ter encontrado em Dylan alguém que finalmente a entende e em quem ela pode confiar plenamente.","air_date":"2023-08-17","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/bH8CqRTTUnrR81mmn32t9RQZhCO.jpg","vote_average":0},"6":{"name":"Parte seis: Roda-de-fogo","overview":"Longe da opressão do Campo de Espinhos, Rama se reconecta com sua cultura e sua própria dor. À medida que Junia finalmente aprende a falar a verdade, o sonho de Alice de ter Dylan como seu parceiro no amor começa a se transformar em um pesadelo.","air_date":"2023-08-24","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/4sELSW6WzGJTTmyPL57ZaLUQnAO.jpg","vote_average":0},"7":{"name":"Parte sete: Ervilha-do-deserto","overview":"Alice é levada a um ponto de colapso físico e emocional, mas, ao superar essa tempestade e aprender a amar e perdoar a si mesma e a sua família, ela reúne forças para usar sua própria voz.","air_date":"2023-08-31","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/zhgJiSfJydYdxT4bnL9rLFAcJaB.jpg","vote_average":0}}}}},
